async function fetchAlphaVantage(){
    try {
        const url=process.env.REACT_APP_ALPHA_VANTAGE_BASE_URL
        const key=process.env.REACT_APP_ALPHA_VANTAGE_API_KEY
        const symbols=['AAPL', 'MSFT', 'AMZN', 'GOOGL', 'FB','BRK-A', 'JNJ', 'WMT', 'V', 'JPM', 'TSLA', 'PG', 'UNH', 'MA', 'NVDA', 'HD', 'BABA', 'DIS', 'PFE', 'KO']
        const stocksPromises=symbols.map(symbol=>
                fetch(`${url}function=GLOBAL_QUOTE&symbol=${symbol}&apikey=${key}`)
                    .then(response=>response.json())
        )
        const stocks=await Promise.all(stocksPromises)
        return stocks    
    } catch (error) {
        console.error(error)
    }
}
export {fetchAlphaVantage}
